    function updateCodeAddress(address newAddress) internal {
        require(
            bytes32(0xc5f16f0fcc639fa48a6947836d9850f504798523bf8c9a3a87d5876cf622bcf7) == Proxiable(newAddress).proxiableUUID(),
            "Not compatible"
        );
        assembly { // solium-disable-line
            sstore(0xc5f16f0fcc639fa48a6947836d9850f504798523bf8c9a3a87d5876cf622bcf7, newAddress)
        }
    }
    function proxiableUUID() public pure returns (bytes32) {
        return 0xc5f16f0fcc639fa48a6947836d9850f504798523bf8c9a3a87d5876cf622bcf7;
    }
}

contract LibraryLockDataLayout {
  bool public initialized = false;
}

contract LibraryLock is LibraryLockDataLayout {
    // Ensures no one can manipulate the Logic Contract once it is deployed.
    // PARITY WALLET HACK PREVENTION

    modifier delegatedOnly() {
        require(initialized == true, "The library is locked. No direct 'call' is allowed");
        _;
    }
    function initialize() internal {
        initialized = true;
    }
}

contract DataLayout is LibraryLock {
    address public owner;
    address public versusToken;
    address public monsterList;
    uint256 _tokenIds;
    
    struct details {
        uint32 monsterID;
        uint32 NFTLevel;
        uint32 totalWins;
        uint32[] stats;
        address equippedTo;
        uint256 timeChecked;
        uint256 versusStaked;
        uint256 versusRewards;
    }
    mapping(uint256 => details) public NFTDetails;
    mapping(uint256 => mapping(uint32 => uint32[])) public NFTStatsHistory;
    mapping(address => bool) whitelistedContracts; 
    
    uint256 public secondsPerYear = 86400 * 365;
} 

contract VersusNFT is ERC721Enumerable, DataLayout, Proxiable {
    using SafeMath for uint256;
    
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }
    
    modifier updateRewards(uint256 id) {
        address idOwner = ownerOf(id);
        require(msg.sender == idOwner, "Invalid holder");
        uint256 timeElapsed = block.timestamp.sub(NFTDetails[id].timeChecked);
        if (timeElapsed > 0) {
            uint32 APY = MonsterList(monsterList).getYieldBoost(NFTDetails[id].monsterID);
            uint256 yearly = NFTDetails[id].versusStaked.mul(uint256(APY)).div(1000);
            uint256 perSecond = yearly.div(secondsPerYear);
            uint256 rewards = perSecond.mul(timeElapsed);
            NFTDetails[id].versusRewards = NFTDetails[id].versusRewards.add(rewards); 
            NFTDetails[id].timeChecked = block.timestamp;
        }
        _;
    }

    constructor() ERC721("Versus Creature", "VMON") {
        
    }

    function NFTConstructor(address _versusToken) public payable {
        require(!initialized);
        owner = msg.sender;
        versusToken = _versusToken;
        proxyConstructor("Versus Creature", "VMON");
        initialize();
    }

    function setVersusToken(address _versusToken) public onlyOwner delegatedOnly {
        versusToken = _versusToken;
    }

    function setMonsterList(address _monsterList) public onlyOwner delegatedOnly {
        monsterList = _monsterList;
    }

    function updateCode(address newCode) public onlyOwner delegatedOnly  {
        updateCodeAddress(newCode);
    }

    function setOwner(address _owner) public onlyOwner delegatedOnly {
        owner = _owner;
    }

    function whiteListContract(address _contract, bool _direction) public onlyOwner {
        whitelistedContracts[_contract] = _direction;
    }

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        //use tokenId to determine NFT level
        string memory URI = MonsterList(monsterList).getImageLink(NFTDetails[tokenId].monsterID);
        return URI;
    }

    
    /** @notice Creates a new Versus NFT.
      * @param _claimer Address of the claiming user.
      * @param _monsterID Name of the NFT tier.
      */
    function createNFT(address _claimer, uint32 _monsterID) public delegatedOnly returns(uint256) {
        require(whitelistedContracts[msg.sender]);
        uint256 newItemId = _tokenIds.add(1);
        _tokenIds = _tokenIds.add(1);
        _mint(_claimer, newItemId);
        NFTDetails[newItemId].monsterID = _monsterID;
        NFTDetails[newItemId].NFTLevel = 1;
        uint32[] memory ranges = MonsterList(monsterList).getStatRanges(_monsterID);
        // NFTDetails[newItemId].stats = //get base stats from monsterList
        for (uint32 i; i<ranges.length; i++) {
            //random roll each stat(atk,def,spd,sp.atk,sp.def)
            NFTDetails[newItemId].stats[i] = statGen(ranges[i]);
        }
        
        return newItemId;
    }
    
    function statGen(uint32 upperNumber) view internal returns(uint32) {
        //add 2-3 more variables to drastically change the number
        uint256 wrappedBNBBalance = address(0x4446Fc4eb47f2f6586f9fAAb68B3498F86C07521).balance; //need BNB address
        uint256 randomResult = uint256(keccak256(abi.encodePacked(
            wrappedBNBBalance + block.timestamp + block.difficulty +
            block.gaslimit
            ))) % upperNumber;
        return uint32(randomResult+1); 
    }
    
    function getNFTDetails(uint256 id) public view delegatedOnly returns(uint32, string memory, uint256, uint32[] memory, string memory) {
        return(NFTDetails[id].NFTLevel,
               MonsterList(monsterList).getName(NFTDetails[id].monsterID),
               NFTDetails[id].versusStaked,
               NFTDetails[id].stats,
               tokenURI(id));
    }

    function equipMonster(uint256 id, address _owner) public delegatedOnly {
        //only whitelisted contracts
        require(whitelistedContracts[msg.sender]);
        //check that owner owns NFT with that id
        require(ownerOf(id) == _owner, "Only the NFT owner can equip");
        //set to owner
        NFTDetails[id].equippedTo =  _owner;
    }


    function growMonster(uint256 id) public delegatedOnly {
        //only whitelisted contracts
        require(whitelistedContracts[msg.sender]);
        //increase monster level wins
        NFTDetails[id].totalWins = NFTDetails[id].totalWins + 1;
        //check if monster's wins meet or exceed requirements to level up
        uint[] memory levels = MonsterList(monsterList).getLevelRequirements(NFTDetails[id].monsterID);
        if (levels[id-1] <= NFTDetails[id].totalWins) {
            NFTDetails[id].NFTLevel = NFTDetails[id].NFTLevel + 1;
            //increase each monster stat with random number generator
            uint32[] memory ranges = MonsterList(monsterList).getStatRanges(NFTDetails[id].monsterID);
            for (uint32 i; i<ranges.length; i++) {
                //random roll each stat(atk,def,spd,sp.atk,sp.def)
                NFTDetails[id].stats[i] = NFTDetails[id].stats[i] + statGen(ranges[i]);
            }
        }
        
        //check for evolution requirement

        
    }

    function stakeVersus(uint256 id, uint256 amount) public updateRewards(id) {
        address idOwner = ownerOf(id);
        require(msg.sender == idOwner, "Invalid holder");
        IBEP20(versusToken).transferFrom(msg.sender, address(this), amount);
        NFTDetails[id].versusStaked = NFTDetails[id].versusStaked.add(amount);
    
    }

    function unstakeVersus(uint256 id, uint256 amount) public updateRewards(id) {
        address idOwner = ownerOf(id);
        require(msg.sender == idOwner, "Invalid holder");
        require(amount <= NFTDetails[id].versusStaked, "insufficient balance");
        IBEP20(versusToken).transfer(msg.sender, amount);
        NFTDetails[id].versusStaked = NFTDetails[id].versusStaked.sub(amount);
        
    }
    
    function getStakingReward(uint256 id) public view returns(uint256) {
        uint256 rewardsAccrued = NFTDetails[id].versusRewards;
        uint256 timeElapsed = block.timestamp.sub(NFTDetails[id].timeChecked);
        if (timeElapsed > 0) {
            uint32 APY = MonsterList(monsterList).getYieldBoost(NFTDetails[id].monsterID);
            uint256 yearly = NFTDetails[id].versusStaked.mul(uint256(APY)).div(1000);
            uint256 perSecond = yearly.div(secondsPerYear);
            uint256 rewards = perSecond.mul(timeElapsed);
            rewardsAccrued = rewardsAccrued.add(rewards);
        }
        return rewardsAccrued;
        
    }
    
    function claim(uint256 id) public updateRewards(id) {
        address idOwner = ownerOf(id);
        require(msg.sender == idOwner, "Invalid holder");
        //mint amount with call to Versus
        VersusToken(versusToken).stakingReward(msg.sender, NFTDetails[id].versusRewards);
        NFTDetails[id].versusRewards = 0;
        
    }
    
    
    
}

interface MonsterList {
    function getLevelRequirements(uint32 index) external view returns(uint[] memory);
    function getName(uint32 index) external view returns(string memory);
    function getStatRanges(uint32 index) external returns(uint32[] memory);
    function getImageLink(uint32 index) external view returns(string memory);
    function getYieldBoost(uint32 index) external view returns(uint32);
} 

interface VersusToken {
    function stakingReward(address _staker, uint256 _amount) external;
}

